    ["1000000"]={id=1000000,name="久远之弦",typeId=10012,quality=3,description="闪烁着纯白光辉的[弦]，[共鸣]的媒介，可用于构建、维系导师与斯露德之间的[联系]。",descriptionCopywriting="并不是人造物，而是一段被保留下来的[现象]，只有在强度、规模相当的极奏与异空互相碰撞时才会出现，就像是剧烈的对流运动会形成雷电一样。附录：我不知道REVO为什么以[弦]来为这种现象命名，我想说的是，我听说过[弦]这个词，在旧时代。它代表一种尝试描述世界本质的假想模型，这种理论认为构成世界的最基本单元是一种尺度极小的[能量弦线]，大至天体，小至夸克，都是由这种[弦]振动产生的。更有趣的是，REVO内部有相当一部分人认为这是物质、时间与空间在巨大压力下呈现出的最为原始的形态，换句话说，他们认为这是一小段[宇宙]。",remarks="",bagOrder=90,iconNameB="",iconName="item_1000000_s",smallIconName="item_1000000_s",limitTime=0,useParam=xlsNilTable,partId=0,decomposeId=0,decomposeNum=0,costCoin=0,saleReward=9999},
