    ["1030006"]={id=1030006,name="ASP17-02A",typeId=10012,quality=4,description="原材料、成分、产地均不明的特种材料，可用于多种强化场合。",descriptionCopywriting="从生物学角度来说，蛇蜕皮是为了继续成长，但祂似乎不太一样，祂是特别的，无论是作为[长子]，还是作为[至蛇]。我翻遍了所有与祂相关的记录，每次蜕皮前后，无论是体型、外观还是行为，都没有任何变化......不，也许确实有什么细微的变化发生了，只不过我们无法察觉而已......那么——祂到底......蜕下了什么？或者说，祂究竟想要蜕下什么？",remarks="高级镜像和律叶通用突破材料",bagOrder=117,iconNameB="",iconName="item_1030006_s",smallIconName="item_1030006_s",limitTime=0,useParam=xlsNilTable,partId=0,decomposeId=0,decomposeNum=0,costCoin=0,saleReward=9999},
